import React from "react";
import { Carousel } from "react-responsive-carousel";

import {
  GalleryContainer,
  GalleryCarousel,
  GalleryCard,
  GalleryH1,
  GalleryImg,
} from "./GalleryElements";

const Gallery = () => {
  return (
    <GalleryContainer>
      <GalleryH1>Image Gallery</GalleryH1>
      <Carousel
        autoPlay
        interval="5000"
        infiniteLoop
        transitionTime="1000"
        // onChange={this.onChangeEvent}
        // onClickItem={this.onClickItemEvent}
        // onClickThumb={this.onClickThumbEvent}
        // onSwipeStart={this.onSwipeStartEvent}
        // onSwipeEnd={this.onSwipeEndEvent}
      >
        <GalleryCard>
          <GalleryImg src="https://picsum.photos/700/400?img=1" />
          <GalleryImg src="https://picsum.photos/700/400?img=2" />
          <GalleryImg src="https://picsum.photos/700/400?img=3" />
        </GalleryCard>
      </Carousel>
    </GalleryContainer>
  );
};

export default Gallery;

// GalleryContainer, GalleryH1, GalleryCarousel, GalleryCard
